    render() {
        return (
            <div>
                <Table bordered>
                    <tbody>
                    <tr>
                        <td>{translate("ORDER_DETAILS.PHONE_NUMBER")}</td>
                        <td>{this.props.address.phoneCustomer}</td>
                    </tr>
                    <tr>
                        <td>{translate("ORDER_DETAILS.OTHER_DETAILS")}</td>
                        <td>{this.props.address.otherDetails}</td>
                    </tr>
                    </tbody>
                </Table>
                <ul></ul>
            </div>
        );
    }
}

export default Address;
